import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles/main.css';
import Console from './Components/Console';

const e = React.createElement;

class App extends React.Component {

  constructor(props){
    super(props);
    this.clearConsole = this.clearConsole.bind(this)
    this.state = {
      console:["alex","alex2"],
      epochs:30
    }

  }

  componentDidMount(){

  }


  clearConsole(){
    console.log('cliecked');
    this.setState({
      console:[]
    })
  }



  render(){
    return (
      e('div',{className:'container c-design'},
        e('div',{className:'row'},
          e('div',{className:'col-md-6 content-console'},
            e('p',null,'Console'),
            <Console console={this.state.console} clearConsole={this.clearConsole}/>,
            e('button',{},'Clear')
            ),
          e('div',{className:'col-md-6 content-admin'},
            e('p',{},'Train')
          ),

        )
      )
    );
  }
}




export default App;
